import React from 'react';
import logo from '../Assets/Waver-testLogo.png';

class TopBar extends React.Component{

    render(){
        return(
            <div className = "bg-yellow shadow-sm mb-2">
                <img src = {logo} width = "60" alt = "Waver"/>
            </div>
        );
    };
}

export default TopBar;
